import { Link } from "react-router-dom";

const started = [
  {
      display: 'Home',
      path: '/'
  },
  {
      display: 'Movies',
      path: '/movie'
  },
  {
      display: 'TV Series',
      path: '/tv'
  }
];

const Form = () => {
  return (
    <form>
      <h3 className="form-title">
        Ready to watch? Enter your email to create or restart your membership.
      </h3>
      <div className="form-main">
        <label className="label-email-wrapper">
          <label className="label-email" htmlFor="email">
            Email address
          </label>
          <input className="input-email" type="email" name="email" id="email" />
        </label>
        <button className="red-btn signup-btn">
          <span>
          <a href="https://www.google.com">get </a>
            <Link to="/Routes">
              <button className="red-btn signup-btn"> Get Started </button>
            </Link>
          </span>
          <span className="chevron-right-arrow">
            <svg viewBox="0 0 6 12" xmlns="http://www.w3.org/2000/svg">
              <desc>chevron</desc>
              <path d="M.61 1.312l.78-.624L5.64 6l-4.25 5.312-.78-.624L4.36 6z"></path>
            </svg>
          </span>
        </button>
      </div>
    </form>
  );
};



export default Form;
